import React from "react";
import { Link } from 'react-router-dom';
import { Routes } from "../routes";
import { Button, Container } from '@themesberg/react-bootstrap';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faExternalLinkAlt } from "@fortawesome/free-solid-svg-icons";
import BgImage from "../assets/img/illustrations/signin.svg";

export default () => {
  return (
    <>
      <Container className="position-relative justify-content-between px-3" style={{ backgroundImage: `url(${BgImage})` }}>
        <Button variant="secondary" as={Link} to={Routes.Signin.path} className="text-dark me-3">
          Explore dashboard <FontAwesomeIcon icon={faExternalLinkAlt} className="d-none d-sm-inline ms-1" />
        </Button>
      </Container>
    </>
  );
};
